import React from "react";
import { Navbar, Nav, Form, FormControl, Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import { FaHeartbeat } from "react-icons/fa"; // emergency icon

function AppNavbar() {
  return (
    <Navbar expand="lg" className="py-3" style={{ backgroundColor: "#f8d7da" }}>
      <Container fluid>
        {/* Left - Logo and Title */}
        <Navbar.Brand as={Link} to="/home" className="d-flex align-items-center">
          <FaHeartbeat size={24} className="me-2 text-danger" />
          <span className="fw-bold fs-5 text-danger">Emergency System</span>
        </Navbar.Brand>

        {/* Center - Search bar */}
        <Form className="d-flex mx-auto w-50">
          <FormControl type="search" placeholder="Search..." className="me-2" />
        </Form>

        {/* Right - Navigation links */}
        <Nav className="ms-auto d-flex gap-3">
          <Nav.Link as={Link} to="/home">Home</Nav.Link>
          <Nav.Link as={Link} to="/register">Register</Nav.Link>
          <Nav.Link as={Link} to="/profile">My Profile</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
